import React from "react";
import { Pie } from "react-chartjs-2";
import {
  Chart as ChartJS,
  ArcElement,
  Tooltip,
  Legend,
} from "chart.js";

ChartJS.register(ArcElement, Tooltip, Legend);


const AgesChart = ({ data }) => {
  if (!data) {
    return <p>Loading age chart...</p>;
  }

  const chartData = {
    labels: data.map((item) => item.ageGroup),
    datasets: [
      {
        data: [
          data["10대"],
          data["20대"],
          data["30대"],
          data["40대"],
          data["50대"],
          data["60대 이상"],
        ],
        backgroundColor: [
          "#FF6384", // 10대: 빨간색
          "#36A2EB", // 20대: 파란색
          "#FFCE56", // 30대: 노란색
          "#4BC0C0", // 40대: 청록색
          "#9966FF", // 50대: 보라색
          "#FF9F40", // 60대 이상: 주황색
        ],
        hoverOffset: 4,
      },
    ],
  };

  return (
    <div>
      <h3>연령별 검색량</h3>
      <Pie data={chartData} />
    </div>
  );
};

export default AgesChart;
